import React from 'react';
import './css/main.css';
import About from './components/About';
import SocialIcons from './components/Social-icons';
import WorkWith from './components/WorkWith';
import NotWorkingWith from './components/NotWorkingWith';
import Training from './components/Training';
import Payment from './components/Payment';
import WorkFormat from './components/WorkFormat';
import LegalAsp from './components/LegalAsp';


function MainPage() {
    return (
        <div className="main">

            <div className="break"></div>
            <Render buttonText="Some text" hiddenText="./components/About.js" />
            <About buttonText="Some text2" />
            <About buttonText="Some text3" />
            <WorkWith />
            <NotWorkingWith />
            <Training />
            <Payment />
            <WorkFormat />
            <LegalAsp />
            <div className="break"></div>

            <SocialIcons />
            

            <div className="break"></div>
            <div className="smi"><a href='/smi'>Статьи</a></div>
        </div>


    )
}


export default MainPage;
